import { Descriptions, Button } from 'antd'
import React from 'react'

class App extends React.Component {
  render() {
    return (
      <div className="App">
        <Button></Button>
        <Descriptions title="Parsed Text" layout="vertical" bordered>
          <Descriptions.Item label="Key">Returned Text</Descriptions.Item>
        </Descriptions>
      </div>
    );
  }
}

export default App;
